        content: 'Hữu Phỉ - Legend of Fei (2021) bộ phim lấy bối cảnh Hậu Chiêu năm Kiến Nguyên thứ 17, non sông chia Nam - Bắc cai trị. Phim truyền hình Trung Quốc Hữu Phỉ xoay quanh cuộc đời con gái chủ trại thổ phỉ - Chu Phỉ (Triệu Lệ Dĩnh thủ vai), nằm ở giữa 2 vùng nam bắc và cũng là nơi bình yên duy nhất tách biệt khỏi khói lửa chiến tranh thời bấy giờ. Chu Phỉ từ nhỏ ngoài việc sống cùng gia đình, luyện võ và vui chơi cùng bạn ra thì nàng chưa từng phải lo nghĩ điều gì. Thế nhưng tại họa bắt đầu ập đến với cô cũng như trại thổ phỉ của cha mình trong một lần xuống núi. Chu Phỉ vô tình cứu được các huynh đệ của mình, rồi theo chân họ làm tiếp nhiệm vụ đưa gia đình một trung thân về trại và chẳng may giữa đường bị quan quân vây giết chỉ còn nàng và 1 tiểu thư thoát được. Từ đây các biến cố liên tục xảy ra và Chu Phỉ bị cuốn vào những âm mưu, ân oán giữa các phe phái, gia tộc. Nàng và chàng thiếu niên Tạ Duẫn (Vương Nhất Bác thủ vai) cùng nhau trải qua những khó khăn cực khổ, cùng nhau trưởng thành, trở thành anh hùng của thời đại và đồng thời là danh dao một thời.',
