        content: 'Thợ Săn Linh Hồn bộ phim kể về câu chuyện của một nhóm những thợ săn hồn ma đã đến trái đất đóng vai nhân viên của một nhà hàng mì để bắt những linh hồn ma quỷ quay trở lại trái đất để theo đuổi cuộc sống vĩnh hằng. Mỗi người đều có những khả năng đặc biệt của riêng mình. So Moon (Joe Byeong Gyu) là một học sinh trung học và anh là thành viên trẻ nhất trong nhóm. Khả năng đặc biệt của anh là sức mạnh thể chất. Khi còn nhỏ, So Moon đã dính vào một vụ tai nạn xe hơi đáng ngờ. Cha mẹ anh qua đời trong vụ tai nạn và anh bị cụt chân trái. Ga Mo Tak (Yu Jun Sang) là một cựu cảnh sát chính trực. Anh bị tai nạn cách đây 7 năm khiến anh mất trí nhớ. Do Ha Na (Kim Se Jeong) có thể cảm nhận được những linh hồn ma quỷ từ cách xa hàng trăm km. Khi chạm vào ai đó, cô có thể đọc ký ức của họ. Trong khi đó, Chu Mae Ok (Yum Hye Ran) là đầu bếp của nhà hàng mì. Còn Choi Jang Mool (Ahn Suk Hwan) là người phụ trách quản lý chi phí của nhóm.',
