        content: 'Phái Côn Luân trước giờ vẫn được coi là danh môn chính phái đệ nhất trong giang hồ, đứng đầu võ lâm trong bao nhiêu năm. Chưởng môn Lý Cảnh Thiên vì bảo vệ toàn thiên hạ, ngăn không cho Lục Bào lão tổ cướp lấy Huyết tinh thạch đã mang Huyết tinh thạch nhập vào thân thể Đinh Ẩn. Đinh Ẩn vì vậy đã gia nhập Thục Sơn, tập kiếm pháp, quyết luyện thành Côn Luân tuyệt học thay dân chúng thiên hạ tìm Lục Bào lão tổ trả thù. Không ngờ sau đó Đinh Ẩn phát hiện con gái Lục Bào lão tổ Ngọc La Sát Ngọc Vô Tâm ngoại hình giống hệt người vợ đã chết của mình. Hai người rơi vào lưới tình không thoát. Trong lúc đó, nội bộ Côn Luân cũng xảy ra nhiều biến cố, kiếp nạn võ lâm đã tới. Đinh Ẩn hợp lực cùng Đan Thần Tử, Lý Tử Anh, Châu Thanh Vân và huynh đệ kết nghĩa Tiểu Trương trải qua nhiều khó khăn gian khổ, lại không ngờ rơi vào một âm mưu lớn hơn. Vì cứu dân chúng thiên hạ, Đinh Ẩn đã quyết định hy sinh bản thân, cùng liều chết với Lục Bào lão tổ. Ngọc La Sát lòng đau khôn xiết, một thân một mình phiêu lãng chân trời góc biển để làm việc thiện, hoàn thành tâm nguyện của Đinh Ẩn. Đan Thần Tử cũng một mình ở lại Côn Luân tiếp nhận chức vị chưởng môn, tiếp tục sự nghiệp vì võ lâm thiên hạ.',
