        content: 'Phim Nửa Là Mật Ngọt, Nửa Là Đau Thương - Love Is Sweet 半是蜜糖半是伤: Bạn phải tin tưởng, thế gian này luôn luôn tồn tại một đoạn yêu thương khiến bạn khắc cốt ghi tâm, cho dù phải kinh qua tám mươi mốt kiếp nạn thầm mến. Giang Quân nữ vương chốn công sở, cô gái sống ngẩng cao đầu, ngoại hình khí phách ngự tỷ, tâm lý biến hóa cứng cỏi. Viên Soái bá vương nơi làm việc, là kiểu đàn ông thâm hiểm trong cuộc sống, ngoại hình nam tính ngang ngạnh, tâm lý vô địch siêu việt. Bọn họ “hai phía một chút không nghi ngờ”, cô lại cùng người khác yêu đương. Mà anh yên lặng làm kẻ yêu thầm, trong lòng hàng ngàn hàng vạn đau đớn không chỗ tỏ, cũng không dám tiến về phía cô thổ lộ tình yêu. Trong lòng anh nảy sinh một kế, chia rẽ bọn họ, cướp lại điều duy nhất trong tim mình. Liệu mưu kế nhỏ đó của anh có thành công? Nếu cô biết anh làm vậy, còn có thể tha thứ? Rời xa, có khi không hẳn bởi chán ghét, mà vì sợ không khống chế nổi yêu thương đối với người kia. Cô cố tình quay đi, anh giật bước ép sát. Cô tựa là chiếc xương sườn trong anh, từng kinh lịch, từng vùng vẫy, tình yêu có đến như mong mỏi? Tình yêu thứ này, nửa là đường mật, nửa là đau thương.',
