        content: 'Phim Từng Đợt Sóng Vỗ - My Mr.Mermaid 2017: Giải bơi lội sinh viên toàn quốc sắp khai mạc, tuyển thủ Kỳ Duệ Phong của trường đại học thể dục phía Nam và tuyển thủ Âu Dương Hằng của trường đại học thể dục phía Bắc bước vào cuộc đối đầu kịch liệt. Mà lúc này Đường Nhất Bạch – thành viên đội tuyển của trường đại học thể dục phía Nam sau khi trải qua 3 năm đầy sóng gió cũng sắp trở lại đường đua trong mùa giải năm nay. Kỳ Thụy Phong bạn thân của anh cùng các đồng đội và huấn luyện viên đều gửi gắm sự kỳ vọng to lớn vào Đường Nhất Bạch, mà chính anh cũng đang cố gắng hết sức để theo đuổi ước mơ của mình. Ngay trước khi giải đấu diễn ra, Đường Nhất Bạch gặp được cô phóng viên thực tập Vân Đóa. Vân Đóa sau khi biết được quá khứ và ước mơ của anh liền hết lòng ủng hộ anh cũng và luôn đứng ra bênh vực anh. Vân Đóa thuê nhà của mẹ Đường Nhất Bạch nhưng hai người lại không hề hay biết. Sau khi vô tình phát hiện sự thật, hai người tiếp xúc càng thân mật và thường xuyên hơn, dần dần nảy sinh tình cảm. Nhưng rồi đợt huấn luyện cam go và căng thẳng khiến Đường Nhất Bạch phải đưa ra lựa chọn giữa tình yêu và ước mơ. Cuối cùng anh chọn cùng Vân Đóa đối diện với mọi khó khăn và thử thách. Cuối cùng, với sự cổ vũ của Vân Đóa và sự giúp đỡ của đồng đội và huấn luyện viên, Đường Nhất Bạch cũng giành được thành tích như mong muốn và tiến bước đến giải đấu quy mô hơn.',
