        content: 'Phim Cổ Kiếm Kỳ Đàm là bộ phim truyền hình cổ trang tiên hiệp chuyển thể từ game.Chuyện xảy ra trong thời thịnh Đường. Đệ tử của Tử Dận chân nhân là Bách Lý Đồ Tô trong người có mang một luồng sát khí thần bí, phải nhờ tới Phần Tịch kiếm để áp chế. Khi diệt thổ phỉ tại Phiên Vân trại, anh quen với Âu Dương Thiếu Cung và Phương Lan Sinh. Thiếu Cung là đệ tử Thanh Ngọc đàn. Trưởng lão Lôi Nghiêm soán vị, Thiếu Cung trốn ra tìm Ngọc Hoành. Bởi Thiếu Cung đang luyện thuốc khởi tử hoàn sinh nên Đồ Tô hy vọng có thể dựa vào đó cứu sống mẹ, mới cùng đi với Thiếu Cung. Trên đường đi tìm Ngọc Hoành, Đồ Tô còn quen biết Phong Tình Tuyết và một con hồ ly hóa thân hình người là Tương Linh. Hồng Ngọc nhận lời sai khiến của Tử Dận chân nhân bí mật bảo vệ Đồ Tô, nhiều lần cứu giúp Đồ Tô khỏi khó khăn nguy hiểm. Thiếu Cung luyện thành đan dược, mẹ của Đồ Tô cuối cùng cũng tỉnh lại, nhưng tới lúc này Đồ Tô mới biết mẹ mình chính là do Thiếu Cung sát hại. Lôi Nghiêm phái người đi bắt Thiếu Cung, muốn hợp tác cùng y mưu việc lớn. Thiếu Cung một mặt lợi dụng sự tin tưởng của Lôi Nghiêm nghiên cứu thuốc độc hại chết Lôi Nghiêm, một mặt âm thầm lên kế hoạch dùng Ngọc Hoành để khống chế Đồ Tô, khôi phục sự nghiệp thống trị Bồng Lai. Phương Lan Sinh phát hiện âm mưu của Thiếu Cung, Đồ Tô được giải trừ phong ấn, cùng mọi người đi tới Bồng Lai quyết chiến với Thiếu Cung. Cuối cùng Thiếu Cung chết, mấy người Phương Lan Sinh, Hồng Ngọc, ...cũng có nơi có chốn, Đồ Tô cùng Phong Tình Tuyết cũng kết thành một đôi chim liền',
