        real_name: 'Chinese Paladin 3 (2009)',
        content: 'Phim Tiên Kiếm Kì Hiệp 3 bắt đầu vào 50 năm trước của Tiên Kiếm 1. Lý Tam Tư lúc này vừa mới chào đời, Kiếm Thánh cũng chưa gia nhập Thục Sơn. Tỏa Yêu Tháp bị phá hủy, rất nhiều yêu ma thoát ra ngoài nhân gian. 1000 năm trước, Thần Tướng Chấn Yêu tên là Phi Bồng trên thần giới, vì để ma tôn Trọng Lầu xâm phạm Tiên Giới , cho nên Thần Giới phái binh tới bắt Phi Bồng, Phi Bồng bị rớt xuống nhân gian, biến thành Thục Sơn Trấn Yêu Kiếm, rồi trải qua nhiều kiếp luân hồi. Người quản lý Thần Thụ ( cây thần ) là Tịch Dao vốn yêu thầm Phi Bồng, sau khi Phi Bồng xuống nhân gian, nàng liền dùng quả của Thần Thụ chế thành nữ tử là Tuyết Kiến đầu nhập nhân gian. Phi Bồng qua nhiều lần luân hồi, lần này đầu thai thành Thái Tử Khương Quốc Long Dương, Khương quốc và Dương Quốc chiến tranh , lúc Long Dương đang chế tạo Ma Kiếm thì quân Dương Quốc đánh vào, Long Dương chết trong loạn quân, còn công chúa Long Quỳ - muội muội Long Dương cũng tự sát, chỉ còn lại Ma Kiếm lưu truyền. Sau nhiều kiếp luân hồi, Phi Bồng hiện nay trở thành Cảnh Thiên, một chàng trai làm chức quản lý đồ cổ ở Vĩnh An, thành Du Châu. Anh có tài nhận biết đồ cổ, rất mê tiền, tham vọng trở thành người giàu nhất thiên hạ hoặc là Thục Sơn kiếm tiên. Sau khi Cảnh Thiên tìm được Ma Kiếm thì quen biết Tuyết Kiến , từ đó cuộc sống của Cảnh Thiên cũng đổi thay. Cảnh Thiên bị cuốn vào cuộc tranh chấp trong nội bộ Đường Gia, và cả cuộc chiến giữa Đường Môn với Phích Lịch Đường. Rồi sau này gặp đệ tử Thục Sơn là Trường Khanh và người yêu Tử Huyên, cho đến việc giúp Thục Sơn tìm kiếm Ngũ Linh Châu, cùng đối phó với Trọng Lầu...',
