        content: 'Trung Quốc làm phim về những anh hùng tuyến đầu chống Covid-19. Sát Cánh 2020 (Vũ Hán Covid-19) – Together (2020) dài hơn 20 tập kể về thành quả lao động miệt mài của những người ngày đêm chống dịch Covid-19. Bộ phim nhận được sự ủng hộ mạnh mẽ của các công ty phim cũng như các cơ quan truyền thông, y tế của đại lục. Dự án mà Trung Quốc đang theo đuổi này được thực hiện lên đến 20 tập với sự chỉ đạo của đội ngũ đạo diễn hùng hậu như Trương Lê, An Kiến, Uông Tuấn… Những ngày đầu tháng 3, có đạo diễn từng cho biết sẽ đến thành phố Vũ Hán để ghi nhận tình hình dịch bệnh giúp cho tác phẩm chân thật hơn. Phương pháp làm phim của các đạo diễn này là sẽ tiến hành phỏng vấn, nghiên cứu chuyên sâu về tình hình dịch Covid-19. Với số lượng lên đến 20 tập phim, các đạo diễn sẽ làm về rất nhiều câu chuyện trong đó. Biên kịch Lục Lục cùng với nhiều biên kịch khác chấp bút cho câu chuyện ca ngợi tinh thần đoàn kết của đại lục trong nỗ lực vượt qua cơn đại dịch cướp đi mạng sống của nhiều người. Theo các trang báo phương Tây đưa tin, trong đó có Hollywood Reporter, Deadline, Variety… thì nền công nghiệp phim ảnh đại lục đang điêu đứng vì dịch Covid-19. Trung Quốc đã phải đóng cửa 70.000 rạp chiếu trên khắp cả nước và không biết đến bao giờ mới mở lại. Trong tình hình chung như vậy, theo báo South China Morning Post, đại lục đẩy mạnh dịch vụ chiếu phim trực tuyến. Nằm trong dòng chảy chung đó, dự án phim Sát Cánh sẽ được chiếu trực tuyến vào tháng 10 tới trên mạng. Sát Cánh có sự góp mặt của rất nhiều diễn viên nổi tiếng như Cận Đông, Tưởng Hân, Dương Dương,… Phim được chia thành 10 phần gồm: Bước ngoặt cuộc đời, Người đưa đò, Người cứu hộ, Đồng nghiệp, Quyết chiến Hỏa Thần Sơn, Tìm kiếm 24h, Người Vũ Hán, Bệnh viện Phương Thương, Tôi là Đại Liên và Khẩu trang. Dự kiến lên sóng vào tháng 10 trên đài truyền hình Đông Phương.',
