        real_name: 'Code Lyoko (2003)',
        content: '"Mật mã Lyoko" kể về một nhóm gồm năm học sinh trường trung học cơ sở Kadic, đó là Aelita Stone, Jeremy Belpois, Ulrich Stern,Yumi Ishiyama và Odd Della Robbia. Những học sinh này du hành tới thế giới ảoLyoko - thế giới trong một siêu máy tính đặt trong tầng hầm của một nhà máy bịbỏ hoang gần Kadic - để đấu tranh chống lại một thực thể số tên là Xana - kẻ luôn muốn thống trị thế giới.Xana không chỉ có khả năng khống chế máy tính và mạng lướiđiện toàn cầu mà còn kiểm soát được con người trong thế giới thực thông quaviệc họ tiếp xúc với các thiết bị này. Cuối phần 3, nhóm kết nạp thêm một người nữa đó là William Dunbar - học sinh mới chuyển tới trường Kadic vào phần 2.Ngay trong lần đầu tiên vào Lyoko (tập 65), William đã bị Xana khống chế và trởthành vũ khí để Xana chống lại nhóm Jeremie từ đó. Phần 4, nhóm bạn của Jeremiephải tìm cách đánh bại Xana và cứu William ra khỏi thế giới ảo đó.Trong một khoảng thời gian dài, chiến đấu cùng người bạncũng là kẻ thù, nhóm của Jeremie đã trải qua nhiều chuyện vui buồn, cuối cùng họ đã đưa được William trở về (tập 93). Để cung cấp năng lượng cho trương trìnhchống lại Xana, cha của Aelita - Franz Hopper, người tạo ra siêu máy tính,Lyoko và Xana đã hi sinh tại thế giới ảo nhưng nhờ đó, Xana đã bị tiêu diệt.Sau đó, họ quyết định tắt chiếc siêu máy tính này đi trongnỗi buồn không thể tả. Người buồn nhất là Aelita, vì nếu tắt chiếc máy, cha của Aelita sẽ bị kẹt trong máy mãi mãi. Họ vì biết 1 điều rằng cuộc sống sẽ thay đổi tốt đẹp hơn và họ đã cùng nhau tắt chiếc siêu máy tính này đi để chuẩn bị cho 1 cuộc sống mới. Nhưng dù có tắt siêu máy tính thì Lyoko luôn ở mãi mãitrong tim của 5 người bạn, và họ sẽ không quên những cuộc chiến rất khó khăn nhưng giúp họ biết thêm về cuộc sống.',
