        content: 'Woo Da Bi là nữ diễn viên trẻ của điện ảnh Hàn Quốc, cô bắt đầu thử sức mình trong các bộ webdrama của xứ kim chi và nhận được nhiều lời khen của khán giả bởi vẻ ngoài xinh đẹp, diễn xuất tự nhiên. Trap 2020 là một trong những bộ phim để lại dấu ấn tốt của người đẹp họ Woo, cô vào vai Yang Hye Ji, sinh viên 21 tuổi, lực học bình thường, có lòng tự trọng cao nhưng lại dễ dàng mềm mỏng hơn bất kỳ ai. Chính vì thế mà cô gặp nhiều rắc rối với bạn trai quen từ khi vẫn là sinh viên năm nhất. Kim Jun Su là một sinh viên đại học, anh đẹp trai và cao ráo. Sau khi hẹn hò với Hye Ji được khoảng nửa năm, anh muốn mối quan hệ của họ tiến xa hơn nữa nhưng không được cô đồng ý. Vì vậy mà anh bắt đầu ngoại tình với Se Yeon, người bạn thân của Hye Ji từ năm 20 tuổi và luôn coi nhau như chị em trong nhà. Liệu chuyện tình rắc rối này sẽ đi về đâu, Jun Su có phải trả giá cho những hành động mà anh ta đã làm với người yêu mình.',
