        content: 'Truyện kể về cậu học sinh 15 tuổi tên Shibuya Yuuri. Cậu bé này nhìn chung là một con người rất bình thường. Có lẽ điều không bình thường duy nhất ở cậu là cái tên Yuuri, cậu thường xuyên bị trêu chọc vì cái tên rất con gái của mình. Cho đến ngày nọ, khi đi học, Yuuri bắt gặp bốn tên côn đồ đang uy hiếp Murata Ken, một anh bạn cùng trường. Bất đắc dĩ, Yuuri đành lên tiếng giải nguy cho Murata khỏi tay bọn côn đồ. Trớ trêu thay, khi cậu đang bị kẹt lại giữa vòng vây thì Murata đã xa chạy cao bay. Kết quả sau đó thật đau thương, Yuuri bị chúng lôi vào WC nữ công cộng, dúi đầu vào bồn cầu. Bất ngờ thay, cái bồn cầu ấy lại là cánh cổng dẫn Yuuri đến một thế giới khác. Và những điểm bình thường như màu tóc, màu mắt của cậu thì tại nơi đó lại trở thành bất thường. Yuuri được Conrad, Gunter tìm thấy. Họ bảo cậu là vua của họ vì bộ dạng đen từ trên xuống dưới: tóc đen, mắt đen, quần áo đen. Yuuri được tiết lộ rằng... cậu chính là Ma Vương, tức Maou đời thứ 27 (Demon King trong tiếng Anh) của vương quốc này. Lúc đầu, Yuuri không tin, cậu ngỡ đây chỉ là một trò chơi PlayStation 2 nào đó. Nhưng sự thật vẫn là sự thật, Yuuri đành phải tiếp nhận ngôi vị Maou (Ma vương), trở thành người thống lãnh của Mazoku (quỷ), chống lại con người. Tại vương quốc quỷ, Yuuri gặp và được bảo vệ bởi 3 anh em hoàng gia, con của Maou đời trước: Gwendal, Conrad, Wolfram và vị pháp sư Gunter.',
