        content: 'Phim Tegami Bachi - Letter Bee có nội dung: Đất nước Amberground được thắp sáng bằng mặt trời nhân tạo. Trung tâm đất nước là thủ đô Akatsuki luôn rực rỡ ánh mặt trời. Thủ đô là nơi sinh sống và làm việc của Nhà nước, tầng lớp thượng lưu và những người được chọn. Xa hơn là vùng Yuusari dành cho dân trí thức, trung lưu. Nơi đây ít được nhận ánh sáng của mặt trời nhân tạo hơn, nên vòm trời luôn mang một màu buồn nhè nhẹ của hoàng hôn. Xa hơn nữa là vùng Yodaka luôn chìm ngập trong bóng tối. Ở đây, những người nghèo khổ, tầng lớp hạ lưu sinh sống trong cái bóng đêm luẩn quẩn không lối thoát. Ba vùng Akatsuki, Yuusari và Yodaka được nối với nhau bằng một cây cầu, và chỉ những người được chọn, được cấp phép của chính phủ mới được đặt chân lên cây cầu. Vì thế, Letter Bee được sinh ra. Họ làm công việc vận chuyển thư - trái tim của người gửi tới người nhận, nối liền Akatsuki, Yuusari và Yodaka. Lag Seeing được mẹ gửi đi tới nhà một người quen với tư cách một lá thư. Letter Bee vận chuyển cậu là Gauche Suede. Trong suốt cuộc hành trình, Gauche và Lag đã cùng nhau trải qua nhiều nguy hiểm. Đến cuối cùng, "thư" đã được vận chuyển tới nơi an toàn. Lag và Gauche tạm biệt nhau. Lag quyết tâm trở thành một Letter Bee vĩ đại giống Gauche, cùng nhắm tới vị trí "Head Bee". Năm nay sau, Lag 12 tuổi, đã trúng tuyển và trở thành một Letter Bee. Trong một lần làm nhiệm vụ, Lag vô tình gặp lại Gauche - Bee đang bị truy nã. Nhưng Gauche đã đánh mất "trái tim", trở thành Noir Marauder và làm việc cho Reverse - một tổ chức phản chính phủ...',
