        content: 'Phim Ngày Phán Xét "Dies Irae" Ngày 1 tháng 5 năm 1945, trước khoảnh khắc Berlin sụp đổ, một nhóm binh sĩ phát xít Đức đã thực hiện một nghi lễ. Không ai biết liệu nghi lễ đó đã thành công hay không, nhưng những người này đã biến mất cùng với nghi lễ đó sau thế chiến. 61 năm sau, tại thành phố Suwahara. Fuji Ren, người vừa chỉ mới xuất viện sau hai tháng kể từ khi đánh một trận sinh tử cùng với người bạn thân Yusa Shirou của mình, đang chuẩn bị chào đón tiết trời mùa Đông, khi lễ Giáng Sinh đang đến gần. Cậu muốn thay đổi cuộc sống thường nhật của mình; nhưng suy nghĩ này sớm bị phá vỡ bởi hàng loạt những chuyện hoang đường, phi lý bỗng xuất hiện, lấy đi những thứ mà Fuji Ren đang cố gắng níu giữ vốn còn sót lại.Cậu ta biết mình cần phải thay đổi dù cho phải vượt sang ranh giới giữa cái phi thường hay sự tầm thường để lấy lại những ngày đơn giản, đầy hạnh phúc đã qua.Đối đầu với Thập Tam Hiệp Sĩ Thánh Thương Hội (Longinus Dreizehn Orden) là phần tiếp theo của một cuộc chiến dang dở, đầy những ác mộng cùng mùi máu tanh. Liệu tương lai dành cho Fuji Ren đang chờ ở phía trước sẽ là gì?',
